import styled from 'styled-components'

export const StyledLoginForm = styled.form`
    background-color: green; 
    display: flex; 
    flex-direction: column; 
    align-items: center; 
    
    div{
        display: flex; 
        align-items: center; 
        font-size: 2rem;
        background: white; 
        font-weight: 700; 
        width: 496px; 
        height: 85px; 
        border-radius: 135px; 

        span{
            margin: 0 30px
        }
    }
`
